var app=angular.module("app",["ngRoute"]).run(function(e,t){e.$on("$viewContentLoaded",function(){t.removeAll()})}).config(function(e){e.when("/person/:id",{templateUrl:"partials/profile.html",controller:"profileCtrl"}).when("/search_result",{templateUrl:"partials/search_result.html"}).when("/news",{templateUrl:"partials/news.html",controller:"newsCtrl",resolve:{newsItem:function(){return"This is a news item produced by the resolve"}}})});